import React from 'react';
import SlickDemo from './component/SlickDemo';
function App() {  
  return (  
    <div className="App">  
    <SlickDemo/>  
    </div>  
  );  
}  
const Home = () => {
  return (
    <div className="body-layout">
       <div className="slick-sldier">  
    <SlickDemo/>  
    </div> 
      <h1>Welcome to GeeksforGeeks</h1>
      
    </div>

  );
};
  
export default Home;
